window.bookSummaryJSON = "<p>The scale of <i>Eve Online</i> meets the game-like <i>Ender’s Game</i>, mixed with the universe and reality of the Expanse, spiced with the multi-role OLD Battlefield (and fully destructible environments).</p> <p>Sphere World heralded a greater change than the balance of power between the guilds and free player clans.</p> <p>As Luke struggles with his new reality, his changing future, Brad and Stuart must struggle with the new authority and power they wield. They’re not just dealing with corporations and hostile takeovers. The Factions of humanity each want a piece of Sphere World, and they’ll do whatever they have to to do so.</p> <p>Sally cares nothing for their problems, only caring about her sole mission. Destroy the Adraxi where they are found. The first scout has been spotted, and she knows that means one thing. Their fleets are coming.</p> <p>Build the warships, load the dropships, and power up the tanks. The net is going to war.</p>"; 
